            QuadratureRule gaussRule = new QuadratureRule(n);
			for(int i = 0; i < n; ++i) {
				QuadratureNode node = new QuadratureNode() {
					Point = Tensor1.Vector(nodes[i]),
					Weight = weights[i]
				};
                gaussRule.Add( node);
            }
			return gaussRule;
        }

